import React, { useEffect, useState } from "react";

// Example prop or context value
const user = {
  username: "Evelyn Sage",
  handle: "@wildwanderer",
  location: "Seattle, WA",
  favoritePark: "Yosemite National Park",
  favoriteParkCode: "yose", // Add the parkCode
  profileImage: "/images/profile-placeholder.jpg",
};

const API_KEY = "wT7qTdbCiApVc0O9U4sDpW0AEFgcfmyB8fHNW42O";

export default function AccountSettings() {
  const [coverImageUrl, setCoverImageUrl] = useState("/images/cover-placeholder.jpg");

  useEffect(() => {
    const fetchParkImage = async () => {
      try {
        const response = await fetch(
          `https://developer.nps.gov/api/v1/parks?parkCode=${user.favoriteParkCode}&api_key=${API_KEY}`
        );
        const data = await response.json();
        const images = data?.data?.[0]?.images;

        if (images && images.length > 0) {
          setCoverImageUrl(images[0].url);
        }
      } catch (error) {
        console.error("Error fetching park image:", error);
      }
    };

    fetchParkImage();
  }, []);

  return (
    <div className="max-w-3xl mx-auto">
      <div className="flex flex-col items-center mb-8">
        <img
          src={coverImageUrl}
          alt={`${user.favoritePark} Cover`}
          className="w-full h-48 object-cover rounded-lg"
        />
        <div className="-mt-12 w-24 h-24 rounded-full overflow-hidden border-4 border-white shadow-lg">
          <img
            src={user.profileImage}
            alt="Profile"
            className="w-full h-full object-cover"
          />
        </div>
        <h2 className="text-xl font-semibold mt-4">
          {user.username} <span className="text-green-600">●</span>
        </h2>
        <p className="text-gray-500">{user.handle}</p>
      </div>

      <h3 className="text-2xl font-bold mb-6">Account Settings</h3>

      <form className="space-y-6">
        <div>
          <label className="block font-medium mb-1">Username</label>
          <input
            type="text"
            className="w-full border rounded p-2"
            defaultValue="EvelynSage"
          />
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block font-medium mb-1">Theme</label>
            <input
              type="text"
              className="w-full border rounded p-2"
              placeholder="Dark"
            />
          </div>
          <div>
            <label className="block font-medium mb-1">Font Size</label>
            <input
              type="text"
              className="w-full border rounded p-2"
              placeholder="Medium"
            />
          </div>
        </div>

        <div>
          <label className="block font-medium mb-1">Location</label>
          <input
            type="text"
            className="w-full border rounded p-2"
            defaultValue={user.location}
          />
        </div>

        <div>
          <label className="block font-medium mb-1">Gallery</label>
          <input
            type="text"
            className="w-full border rounded p-2"
            placeholder="Upload your favorite park photos"
          />
        </div>

        <div>
          <label className="block font-medium mb-1">Notes Upload</label>
          <div className="border-2 border-dashed rounded-lg p-6 text-center text-gray-400 cursor-pointer hover:border-green-500">
            <span className="block">📎</span>
            Add an attachment (optional)
          </div>
        </div>

        <div className="flex space-x-4">
          <button
            type="submit"
            className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700"
          >
            Save Changes
          </button>
          <button
            type="button"
            className="border px-4 py-2 rounded hover:bg-gray-100"
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
}
